    def parse(self, response):
        for i in range(2, 93):
            url_list = 'http://www.3lian.com/zl/114/09/0906/index_' + str(i) +'.html'
            self.collect_url.append(url_list)
        for url_id in self.collect_url:
            yield scrapy.Request(url= url_id, dont_filter=True, headers=self.headers, callback=self.parse_url_shengyu)
        # url_list = 'http://www.3lian.com/zl/2014/06/30/224266.html'
