    #分类预处理函数，提取所有的url
    def parse_url(self,response):
        try:
            second_url = response.xpath('/html/body/div[3]/div[1]/div[5]/ul/dl/dd/h2/a/@href').extract()
            for node_url in second_url:
                now_url = 'http://www.3lian.com' + node_url
                yield scrapy.Request(url=now_url, dont_filter=True,
                                     headers=self.headers, callback=self.parse_url_collect)
        except Exception as e:
            print(e)

    #在数据库中未被处理的url，进行筛选
    def parse_url_shengyu(self,response):
        try:
            second_url = response.xpath('/html/body/div[3]/div[1]/div[5]/ul/dl/dd/h2/a/@href').extract()
            for node_url in second_url:
                now_url = 'http://www.3lian.com' + node_url
                if now_url not in self.all_parsed_url:
                    yield scrapy.Request(url=now_url, dont_filter=True,
                                     headers=self.headers, callback=self.parse_shengyu)
        except Exception as e:
            print(e)

    #正常情况下处理分类，提取到的url进行关键词分类，暂时分为：title里有‘故事’，‘联集’；html文本里面有‘上联’，‘下联’，只有‘横批’，无任何标识
    def parse_url_collect(self,response):
        try:
            a = response.xpath("//div[@class='article']/div[@class='art_tit']/h1/text()").extract()
            if len(a) == 0:
                titles = response.xpath("//div[@id='left']/div[@class='name']/h1/text()").extract()
                title = titles[0]
            else:
                title = a[0]
            if '联集' in title and '集锦' not in title and '集萃' not in title:
                if response.url not in self.lianji_url:
                    self.lianji_url.append(response.url)
                    yield scrapy.Request(url= response.url, dont_filter=True,
                                         meta= {"title": title}, callback=self.parse_lianji_url)
            elif '故事' in title:
                if response.url not in self.lianji_url and response.url not in self.gushi_url:
                    self.gushi_url.append(response.url)
                    yield scrapy.Request(url=response.url, dont_filter=True,
                                         meta={"title": title}, callback= self.parse_gushi_url)
            else:
                b = response.xpath("//div[@class='article']/div[@class='art_cont']").extract()
                if len(b) == 0:
                    # //*[@id="left"]/div[5]/p[1]/strong
                    htmls = response.xpath("//div[@id='left']/div[contains(@class, 'content14')]").extract()
                    html = htmls[0]
                else:
                    html = b[0]
                if '上联' in html or '下联' in html:
                    if response.url not in self.shangxialian and response.url not in self.lianji_url \
                            and response.url not in self.gushi_url:
                        self.shangxialian.append(response.url)
                        yield scrapy.Request(url=response.url, dont_filter=True, meta={"title": title},
                                             callback=self.parse_shangxialian_url)
                else:
                    if '横批' in html:
                        if response.url not in self.shangxialian and response.url not in self.lianji_url and response.url not in self.hengpi_url \
                                and response.url not in self.gushi_url and response.url not in self.html_shengyu_url:
                            self.hengpi_url.append(response.url)
                            yield scrapy.Request(url=response.url, dont_filter=True, meta={"title": title},
                                                 callback=self.parse_only_hengpi_url)
                    else:
                        if response.url not in self.shangxialian and response.url not in self.lianji_url and response.url not in self.hengpi_url \
                                and response.url not in self.gushi_url and response.url not in self.html_shengyu_url:
                            self.html_shengyu_url.append(response.url)
                            yield scrapy.Request(url=response.url, dont_filter=True, meta={"title": title},
                                                 callback=self.parse_detail)

        except Exception as e:
            print(e)

