    #在数据库中进行处理删选后剩余的url进行如下处理，主要是提取html（全部的文本内容）
    def parse_shengyu(self,response):
        duilian = DuilianItem()
        duilian["html_url"] = response.url
        md5 = get_md5(response.url.encode('utf-8'))
        duilian['md5'] = md5
        a = response.xpath("//div[@class='article']/div[@class='art_tit']/h1/text()").extract()
        if len(a) == 0:
            titles = response.xpath("//div[@id='left']/div[@class='name']/h1/text()").extract()
            title = titles[0]
        else:
            title = a[0]
        duilian['title'] = title
        b = response.xpath("//div[@class='article']/div[@class='art_cont']").extract()
        if len(b) == 0:
            # //*[@id="left"]/div[5]/p[1]/strong
            htmls = response.xpath("//div[@id='left']/div[contains(@class, 'content14')]").extract()
            html = htmls[0]
        else:
            html = b[0]
        if '\xa0' in html:
            html = html.replace('\xa0', '')

        duilian['html'] = html


        yield duilian